import Demande from './Demande';

class newIn extends Component {
    
    constructor(props){
        super(props);
        this.state ={
            isLoading : true,
            projects:[]
        }
    }

    componentDidMount(){
        this.fetchData();
    }

    fetchData(){
        fetch('http://127.0.0.1:8000/api/projet/get/new')
        .then(response => response.json())
        .then(parsedJs
            // parsedJSON => parsedJSON.data.map(proj => (
            // {
            //     titre : `${proj.titre}`,
            //     projet_id : `${proj.projet_id}`,
            // }
            // ))
            )
        .then(projects => this.setState({
            projects,
            isLoading: false
        }))
        .catch(error => console.log('parsing failed', error))
    }

    render() { 
        return ( 
            <div class='content'>
                {
                    this.state.projects.map(proj => <Demande titre={proj.titre} key={proj.projet_id} imgUrl="https://picsum.photos/640/360"/>)
                    
                }
            </div>
         );
    }
}
 
export default newIn;
